import React from "react";

function Add(num1,num2){
    return num1 + num2;
}

function Multiply(num1,num2){
    return num1 * num2;
}

function Subtract(num1,num2){
    return num1 - num2;
}

function Divide(num1,num2){
    return num1 / num2;
}

export {Multiply, Subtract, Add, Divide};
